import React from 'react';
import '../App.css';
import {Row,Col,ResponsiveEmbed,Image,Grid} from 'react-bootstrap';
import '../css/videoPage.css';
class ContentVideoPage extends React.Component {

    constructor(props){
        super(props);
        this.state={
          content:[],
          info:[],
        }
    }

    render() {
        return (
            <div>
                <Grid>
                <Row >
                    <Col className="col-lg-3 col-md-2 col-sm-1 col-xs-1"></Col>
                    <Col className="col-lg-6 col-md-8 col-sm-10 col-xs-12">
                        <h1 className="title-page"><b>VIDEO HOT</b></h1>
                    </Col>
                    <Col className="col-lg-3 col-md-2 col-sm-1 col-xs-1"></Col>
                </Row>

                    <Row >
                        <Col lg={7} md={8} sm={8} xs={12}>
                        <iframe title="video-hot" width="100%" height="360" src="https://www.youtube.com/embed/jqvmZMg4huo?list=RDjqvmZMg4huo" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>

                        </Col>

                        <Col className="info-video" lg={5} md={4} sm={4} xs={12}>
                            <h3>Mình Yêu Nhau Từ Kiếp Nào? [cover] | Quang Trung | Official Music Video 4k</h3>
                            <Row>
                                <Col lg={2} className="avatar"><Image className="avatar-image" width="60px" src="https://yt3.ggpht.com/a-/AAuE7mCsDOmRbcKkJ84jW5zIjwXx6zMf4wC926l5Xw=s288-mo-c-c0xffffffff-rj-k-no"></Image></Col>
                                <Col lg={10}><p class="info"> <br></br>Quang Trung Official <br></br>Published on Jul 24, 2018</p></Col>
                            </Row>


                        </Col>
                    </Row>
                </Grid>
            </div>
          );
      }
}
export default ContentVideoPage;
